import React from 'react';
import {PRODUCTS} from "../../products"

const Shop = () => {
    return (
        <div className='shop'>
            <div className='shopTitle'>
                <h1>PedroTech Shop</h1>
            </div>
            <div className='products'>
                {PRODUCTS.map(() => {
                    return(
                        <h1>{e.id}</h1>
                    )
                })}
            </div>
        </div>
    );
};

export default Shop;
